import React, { useState } from 'react';

const App = () => {
  const [activeTab, setActiveTab] = useState('driven');

  const renderContent = () => {
    switch (activeTab) {
      case 'driven':
        return <p>This is content for Driven Piles</p>;
      case 'bored':
        return <p>This is content for Bored / CFA Piles</p>;
      case 'screw':
        return <p>This is content for Screw Piles</p>;
      default:
        return null;
    }
  };

  return (
    <div className="App">
      <header>
        <h1>Axial Capacity Calculator using CPT</h1>
        <h2>University of Western Australia</h2>
      </header>

      <div className="tabs">
      <button 
        onClick={() => setActiveTab('driven')}
        className={activeTab === 'driven' ? 'active' : ''}
      >
        Driven Piles
      </button>
      <button 
        onClick={() => setActiveTab('bored')}
        className={activeTab === 'bored' ? 'active' : ''}
      >
        Bored / CFA Piles
      </button>
      <button 
        onClick={() => setActiveTab('screw')}
        className={activeTab === 'screw' ? 'active' : ''}
      >
        Screw Piles
      </button>
    </div>


      <div className="tab-content">
        {renderContent()}
      </div>
    </div>
  );
};

export default App;
